import style from './LoginForm.module.css';

const LoginForm = () => {

    return (
        <div className={style.container}>
        <div className={style.backgroundButton}>
            <button className={style.button}>
                ENTER NOW!!
            </button>
        </div>
        </div>
    )
}

export default LoginForm
